import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import {FormsModule, ReactiveFormsModule} from "@angular/forms";
import { AppRoutingModule } from './Login/app-routing.module';
import { AppComponent } from './Login/app.component';
import {httpRequests} from "./Login/http";
import {HttpClientModule} from "@angular/common/http";
import {AuthGuard} from "./auth/AuthGuardService";
import { HomeComponent } from './home/home.component';


@NgModule({
  declarations: [
    AppComponent,
    HomeComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    ReactiveFormsModule,
    HttpClientModule,

  ],
  providers: [httpRequests,AuthGuard],
  bootstrap: [AppComponent]
})
export class AppModule { }
